import React from "react";
import "./App.css";
import ChatWindow from "./components/ChatWindow";

function App() {
  return (
    <div className="App">
      {/* Top Navigation Bar */}
      <div className="navbar">
        <div className="logo">
          {<img src="/logo.png" alt="PartSelect Logo" />}
          PartSelect Virtual Assistant
        </div>
        <div className="nav-links">
          <a href="#">Find Product</a>
          <a href="#">Order Support</a>
        </div>
      </div>

      {/* Main Content Area */}
      <div className="main-content">
        <ChatWindow />
      </div>
    </div>
  );
}

export default App;
